(function ($, Drupal) {
    Drupal.behaviors.dependentDropdowns = {
        attach: function (context, settings) {
            $('#edit-country').once('view-projects').change(function () {
                const selectedCountry = $(this).val();
				$(".form-item-city").css("display", "none");
				if(selectedCountry.length > 0) {
					$('#edit-city').prop('disabled', true);
					$.ajax({
						url: '/get-cities-by-country/' + selectedCountry,
						type: 'GET',
						success: function (data) {
							if(data.length > 0) {
								const cityDropdown = $('#edit-city');
								cityDropdown.empty();
								//cityDropdown.append(new Option('- Any -', 'All'));								
								data.forEach(function (city) {
									cityDropdown.append(new Option(city.name, city.id));
								});
								cityDropdown.prop('disabled', false);
								$(".form-item-city").css("display", "block");
								let citiesInUrl = new URLSearchParams(window.location.search).getAll('city[]');
								if(citiesInUrl.length > 0) {
									$('#edit-city').val(citiesInUrl);
								}
							}
						}
					});
				}
            });
			$('document').ready(function(){				
				$(".form-item-city").css("display", "none");
				let countriesInUrl = new URLSearchParams(window.location.search).getAll('country[]');
				let filterReset = new URLSearchParams(window.location.search).get('reset_filters');
				if(countriesInUrl.length > 0) {
					$('#edit-country').trigger('change');
				} else if(countriesInUrl.length == 0 && filterReset != 1) {
					if(Drupal.eu_cookie_compliance.hasAgreed()) {
						let cookie_country_name = getCookie('country_name');
						if(cookie_country_name == '') {
							$.ajax({
								url: '/get-country-by-ip',
								type: 'GET',
								success: function (data) {
									if(data.connection.organization_type != "Internet Hosting Services") {
										if(data.country_name != '' && data.country_name != null) {
											document.cookie = "country_name=" + data.country_name + "; expires=" + new Date(Date.now() + 30*24*60*60*1000).toUTCString() + "; path=/; SameSite=None; secure=false";
											getCountryIdByName(data.country_name);
										}
									}
								}
							});
						} else {
							getCountryIdByName(cookie_country_name);
						}
					}
				}
			});
			
			function getCookie(cname) {
			  let name = cname + "=";
			  let ca = document.cookie.split(';');
			  for(let i = 0; i < ca.length; i++) {
				let c = ca[i];
					while (c.charAt(0) == ' ') {
						c = c.substring(1);
					}
					if (c.indexOf(name) == 0) {
						return c.substring(name.length, c.length);
					}
				}
				return "";
			}
			
			function checkAdminLogin() {
				if (document.querySelector("#toolbar-administration")) {
					return true;
				} else {
					return false;
				}
			}
			
			function getCountryIdByName(country_name) {
				$.ajax({
					url: '/get-country-id-by-name/' + country_name,
					type: 'GET',
					success: function (country_id) {
						if(!checkAdminLogin()) {
							window.location.href = '/projects?country[]=' + country_id;
						}
					}
				});
			}
        }
    };
	Drupal.behaviors.modifyResetButtonUrl = {
		attach: function (context, settings) {
			$("#edit-reset", context).once("modifyResetButtonUrl").on("click", function () {
				event.preventDefault();
				let url = new URL(window.location.href);
				url.search = "?reset_filters=1";
				window.location.href = url.toString();
			});
		},
	};
	Drupal.behaviors.modifyApplyButtonUrl = {
		attach: function (context, settings) {
			$(document).on("submit", ".views-exposed-form", function (event) {					
					let selectedValues = [];
					let fieldSelector = "select[name='country[]'] option:selected";
					$(fieldSelector).each(function () {
						selectedValues.push($(this).val());
					});
					if (selectedValues.length === 0) {
						event.preventDefault();
						let form = $(this);
						let url = new URL(form.attr("action"), window.location.origin);
						//Preserve selected parameters
						let project_type = $('#edit-project-type').val();
						url.searchParams.set("project_type", project_type);
						
						// Add a custom parameter
						url.searchParams.set("reset_filters", "1");
						window.location.href = url.toString();
					}
			});
		},
	};
})(jQuery, Drupal);
;
/**
 * @file
 * better_exposed_filters.js
 *
 * Provides some client-side functionality for the Better Exposed Filters module.
 */

(function ($, Drupal, drupalSettings) {
  Drupal.behaviors.betterExposedFilters = {
    attach: function (context, settings) {
      // Add highlight class to checked checkboxes for better theming.
      $('.bef-tree input[type=checkbox], .bef-checkboxes input[type=checkbox]')
        // Highlight newly selected checkboxes.
        .change(function () {
          _bef_highlight(this, context);
        })
        .filter(':checked').closest('.form-item', context).addClass('highlight');
    }
  };

  /*
   * Helper functions
   */

  /**
   * Adds/Removes the highlight class from the form-item div as appropriate.
   */
  function _bef_highlight(elem, context) {
    $elem = $(elem, context);
    $elem.attr('checked')
      ? $elem.closest('.form-item', context).addClass('highlight')
      : $elem.closest('.form-item', context).removeClass('highlight');
  }

})(jQuery, Drupal, drupalSettings);
